import { MdEventSeat } from "react-icons/md";
import "../styles/seat.css"; // Make sure this file exists

interface SeatProps {
  status: "available" | "selected" | "sold";
  onClick: () => void;
}

const Seat = ({ status, onClick }: SeatProps) => {
  return (
    <div className="seat-wrapper" onClick={onClick}>
      <MdEventSeat className={`seat-icon ${status}`} size={28} />
    </div>
  );
};

export default Seat;
